import axios from 'axios'

export const getUserData = async () => {
    const x = await axios.get(`${process.env.REACT_APP_ENDPOINT}/API/getUser`)
    return x.data
}

export const getTrades = async (data: string) => {
    const trades = await axios.get(`${process.env.REACT_APP_ENDPOINT}/API/getUser`, {data})
    return trades.data;
}
